import "./LoginFooter.css";

const LoginFooter = () => {
  return (
    <div className="login-footer-container">
      <img className="login-footer-pic" src="/login/picture.svg" />
      <div className="login-footer-bg"></div>
    </div>
  );
};

export default LoginFooter;
